import React from "react";
const Result=(props)=>{
    const pic=`https://source.unsplash.com/user/erondu/1600x900?${props}`
    return <>
    
        <div className="pic">
            <img src={pic} alt="Not Available"/>
        </div>
    </> ;
}
export default Result;
